def my_func(*inputs): 
    def transform_string(s):
        parts = s.split(' ')
        transformed_parts = []
        for part in parts:
            sub_parts = part.split('-')
            # Capitalize each sub-part except the first one
            transformed_sub_parts = [sub_parts[0]] + [sub_part.capitalize() for sub_part in sub_parts[1:]]
            transformed_parts.append(''.join(transformed_sub_parts))
        return ' '.join(transformed_parts)

    outputs = []
    for input_str in inputs:
        if input_str is None:
            outputs.append(None)
        elif 1 <= len(input_str) <= 20:
            outputs.append(transform_string(input_str))
        else:
            raise ValueError("Input string length must be between 1 and 20 characters.")

    return outputs

